def solve():
    # Clean stabilizers
    global stabilizers
    stabilizers = [s.strip() for s in stabilizers]
    
    print(f"Number of stabilizers: {len(stabilizers)}")
    lengths = set(len(s) for s in stabilizers)
    print(f"Lengths: {lengths}")
    
    for i, s in enumerate(stabilizers):
        if len(s) != 153:
            print(f"Stabilizer {i} has length {len(s)}")
            
    if len(lengths) > 1:
        print("Error: Stabilizers have different lengths!")
        return

    # Try to construct a tableau from these stabilizers
    try:
        t = stim.Tableau.from_stabilizers([stim.PauliString(s) for s in stabilizers])
        print("Successfully created tableau from stabilizers.")
        c = t.to_circuit()
        print("Circuit generated.")
        
        with open("circuit_solution.stim", "w") as f:
            f.write(str(c))
            
    except Exception as e:
        print(f"Error creating tableau: {e}")
        
        # Check commutation manually
        s_paulis = [stim.PauliString(s) for s in stabilizers]
        for i in range(len(s_paulis)):
            for j in range(i + 1, len(s_paulis)):
                if s_paulis[i].commutes(s_paulis[j]) == False:
                    print(f"Anticommutes: {i} and {j}")
                    print(f"S[{i}]: {stabilizers[i]}")
                    print(f"S[{j}]: {stabilizers[j]}")
                    # Print indices where they differ
                    diffs = []
                    for k in range(len(stabilizers[i])):
                        c1 = stabilizers[i][k]
                        c2 = stabilizers[j][k]
                        if c1 != 'I' and c2 != 'I' and c1 != c2:
                            diffs.append(k)
                    print(f"Anticommute at indices: {diffs} (count: {len(diffs)})")
                    return

if __name__ == "__main__":
    solve()
